import React from 'react'
import './index.css';

function Common(props) {
  return (
    <div className='common'>
      <img src={props.img} ></img>
      <style jsx>
        {
          ` img{
              margin: 10px 20px 0px 0px;
            }
          `
        }
      </style>
      {props.name}
    </div>
  )
}

export default Common
